import SearchBar from './SearchBar';

const inputs = [
  {
    label: 'Inclui o texto',
    type: 'text',
    id: 'searchText',
    name: 'searchText',
    htmlFor: 'searchText',
    onChange: SearchBar.onSearchTextChange,
    value: SearchBar.searchText,
  },
];

export default inputs;
